import React from 'react';
import { View, Text, Button, StyleSheet, TextInput } from 'react-native';

function Login() {
  return (
    <View>
        <Text>Email:</Text>
        <TextInput
            style={styles.input}
            placeholder="ID"
        />
        <Text>Password:</Text>
        <TextInput
            style={styles.input}
            placeholder="Password"
        />
        <Button
            style={styles.btn}
            title='Sign in'
        />
        <Text>Don't have an account? Sign up <Button title='here'/> </Text>
    </View>
  )
}

const styles = StyleSheet.create({
    input: {
        height: 40,
        margin: 12,
        borderWidth: 1,
        padding: 10,
        backgroundColor: "3E8CE4",
        roundness: 50,
    },
    btn: {
        display: "flex",
        flexDirection: "row",
        backgroundColor: "black"
    }
});

export default Login
